css:
.ask-stack .loading {
  margin: auto;
  margin-top: 1em;
  margin-bottom: 1em;
}
.ask-stack-result {
  font-size: 14px;
  line-height: 1.6;
  background-color: #333232;
  color: #fff;
  overflow: scroll;
  padding: 15px;
}
.radio-label {
  margin-right: 4px;
}
.radio-label.last {
  margin-left: 8px;
}
.load-more {
  position: relative;
  margin-top: 20px;
  margin-left: 60px;
  text-align: center;
}
.load-more span {
  color: #A2A1A1;
}
.load-more span:hover {
  color: #DCDCDC;
}
.load-more a {
  text-decoration: none;
}
.progressIndicator {
  margin-left: auto;
  margin-right: auto;
  width: 0%;
  display: none;
}
.ui-result {
  position: relative;
  background: #f2f2f6;
  color: #232323;
  padding: 1px 8px 8px;
  margin-bottom: 10px;
  border-left: 55px solid #fd8a07;
  border-right: 5px solid #fd8a07;
  font-family: "proxima-nova", sans-serif;
  box-shadow: 0 1px 4px rgba(250, 250, 250, 0.7);
}
.ui-result .nav-tabs {
  background-color: #f2f2f6;
  border: none;
  margin-top: 5px;
  border-radius: 4px 4px 0 0;
}
.ui-result .nav-tabs li a {
  border-radius: 7px 7px 0 0;
  color: #000;
}
.ui-result .nav-tabs li a:hover {
  background-color: #e9e9e9;
  color: #000;
}
.ui-result .nav-tabs li.active a {
  border-radius: 7px 7px 0 0;
  background-color: #DADADD;
  color: #000;
  border-bottom-color: #DADADD;
}
.ui-result .nav-tabs .active a:hover {
  background-color: #DADADD;
  color: #000;
  border-bottom-color: #DADADD;
}
.ui-result a {
  color: #428bca;
  word-wrap: break-word;
}
.ui-result a.underline {
  color: #222;
  text-decoration: underline;
}
.ui-result a.underline:visited {
  color: #222;
}
.ui-result a.underline:active {
  color: #222;
}
.ui-result .btn {
  color: #999;
  margin-left: 1px;
  margin-right: 4px;
  margin-top: -5px;
  float: right;
}
.ui-result .btn:visited {
  color: #999;
}
.ui-result .btn:active {
  color: #999;
}
.ui-result .btn:focus {
  outline: 0;
}
.ui-result .btn.btn-info {
  color: #000;
  background-image: none;
  background-color: #fff;
  border: 1px solid #bbb;
  border-radius: 4px;
  line-height: 1.5;
  position: relative;
  float: none;
  margin-top: 8px;
}
.ui-result .btn.btn-info:hover {
  color: #000;
  background-image: none;
  background-color: #e9e9e9;
}
.ui-result .btn.btn-info:focus {
  outline: 0;
}
.ui-result .answer-navigation a {
  text-decoration: none;
}
.ui-result .collapse-button {
  text-align: center;
}
.ui-result hr {
  margin-top: 5px;
  margin-bottom: 10px;
  border-top: 1px solid #DADADD;
}
.ui-result blockquote p {
  font-size: 13px;
}
.ui-result .label-success {
  position: relative;
  float: right;
  font-size: 80%;
  padding: .4em .8em .3em;
}
.ui-result .title {
  font-weight: normal;
  position: relative;
  margin-bottom: 0px;
  margin-top: 20px;
}
.ui-result .title .title-string {
  display: block;
  position: relative;
  font-size: 0.8em;
  line-height: 1.1em;
}
.ui-result .title .score {
  position: absolute;
  left: -60px;
  top: 1px;
  background: white;
  border-radius: 5px;
  width: 50px;
  height: 25px;
}
.ui-result .title .score p {
  color: gray;
  text-align: center;
  font-size: 0.8em;
}
.ui-result .title .answers {
  position: absolute;
  left: -60px;
  top: 31px;
  background: green;
  border-radius: 5px;
  width: 50px;
  height: 25px;
}
.ui-result .title .answers p {
  color: greenyellow;
  text-align: center;
  font-size: 0.8em;
}
.ui-result .title .is-accepted {
  position: absolute;
  left: -60px;
  top: 61px;
  background: transparent;
  border-radius: 5px;
  width: 50px;
  height: 25px;
}
.ui-result .title .is-accepted p {
  color: black;
  text-align: center;
  font-size: 0.8em;
}
.ui-result .score.answer {
  font-family: 'Lucida Grande', 'Segoe UI', sans-serif;
  margin-top: -15px;
  position: relative;
  left: -60px;
  top: 1px;
  background: white;
  border-radius: 5px;
  width: 50px;
  height: 25px;
  color: gray;
  text-align: center;
  font-size: 1.2em;
}
.ui-result .score.is-accepted {
  font-family: 'Lucida Grande', 'Segoe UI', sans-serif;
  margin-top: -15px;
  position: relative;
  left: -60px;
  top: 21px;
  background: transparent;
  border-radius: 5px;
  width: 50px;
  height: 25px;
  color: green;
  text-align: center;
  font-size: 1.2em;
}
.ui-result .answer-navigation div .created {
  background: peachpuff;
  border-radius: 5px;
  text-align: center;
}
.ui-result .answer-link {
  position: relative;
  float: right;
  margin-left: 5px;
}
.ui-result pre {
  height: auto;
  width: auto;
  border-radius: 0px;
  margin-top: -5px;
  margin-bottom: 5px;
}
.ui-result pre code {
  color: #fff;
}
.ui-result code {
  color: #c7254e;
}
.ui-result .created {
  top: 10px;
  font-size: 0.8em;
  font-style: italic;
}
.ui-result .tags a {
  color: #eaeaea;
}
